    constructor(props) {
        super(props);

        this.state = {
            count: ''
        }

    }

    componentDidMount() {
        fetch('/api/resources/instructor/get-instructors')
            .then(res => {
                return res.json();
            })
            .then(json => {
                this.setState({count: json.length})
            })
            .catch(err => {
                console.log('error: ' + err);
