                                    {/*</div>*/}
                                    {/*<div className='card form-group'>*/}
                                        {/*<h5>Notice 2</h5>*/}
                                        {/*<p>This is a good notice</p>*/}
                                        {/*<div className='text-right'>*/}
                                            {/*<button type='button' className='btn btn-primary'>Update</button>*/}
